INSERT INTO `livre` (`livre_id`, `titre`, `auteur`, `id_genre`, `format`, `editeur`, `description`, `stock`, `prix`, `pages`, `date_publication`, `image`) VALUES
(9, 'La femme de ménage', 'Freida McFadden', 4, 'Poche', 'J\'ai Lu', 'Chaque jour, Millie fait le ménage dans la belle maison des Winchester, une riche famille new-yorkaise. Elle récupère aussi leur fille à l\'école et prépare les repas avant d\'aller se coucher dans sa chambre, au grenier. Pour la jeune femme, ce nouveau travail est une chance inespérée. L\'occasion de repartir de zéro. Mais, sous des dehors respectables, sa patronne se montre de plus en plus instable et toxique. Et puis il y a aussi cette rumeur dérangeante qui court dans le quartier : Mme Winchester aurait tenté de noyer sa fille quelques années auparavant. Heureusement, le charmant M. Winchester est là pour rendre la situation plus supportable. Mais le danger se tapit parfois sous des apparences trompeuses. Et lorsque Millie découvre que la porte de sa chambre mansardée ne ferme que de l\'extérieur, il est peut-être déjà trop tard...', '30', 8.60, 416, '2023-10-04', );
INSERT INTO `livre` (`livre_id`, `titre`, `auteur`, `id_genre`, `format`, `editeur`, `description`, `stock`, `prix`, `pages`, `date_publication`, `image`) VALUES
(12, 'Un automne pour te pardonner', 'Morgane Moncomble', 1, 'Broché', 'Hugo Roman', 'Avocate en devenir, Camélia est passionnée de crimes non résolus.\r\n\r\nÇa tombe bien, Rory Cavendish, son ancien bourreau, vient de mourir mystérieusement. Le présumé coupable du meurtre, c’est lui : Lou McAllister. Le meilleur ami de Rory. Le garçon qui l’a humiliée il y a dix ans et qu’elle n’a jamais oublié depuis.\r\n\r\n\r\nCamélia saisit cette chance pour résoudre sa première enquête... et satisfaire sa soif de vengeance.\r\n\r\nLou a toujours été le mouton noir de sa famille, mais il ne s’attendait pas à finir en prison pour meurtre. Du jour au lendemain, le voilà abandonné par tous ceux en qui il avait confiance. La seule personne à pouvoir le sortir de là, c’est elle. Camélia O\'Brien. La première victime de Rory. La fille qu’il a blessée plus jeune et qui hante ses pensées depuis.\r\n\r\nLou est prêt à tout pour se faire pardonner ses péchés... et repartir de zéro.', '30', 17.00, 256, '2023-09-20', );
INSERT INTO `livre` (`livre_id`, `titre`, `auteur`, `id_genre`, `format`, `editeur`, `description`, `stock`, `prix`, `pages`, `date_publication`, `image`) VALUES
(14, 'Un hiver pour te résister', 'Morgane Moncomble', 1, 'Broché', 'Hugo Roman', 'Star montante du patinage artistique, Lily n\'a qu\'un seul objectif : remporter la médaille d\'or au Championnat Mondial. Lorsqu\'elle rencontre son nouveau partenaire, elle est aux anges.\r\n\r\nSon modèle de toujours, c\'est lui : Orion Williams.\r\n\r\nL\'homme qu\'elle se surprend à mépriser dès leur première rencontre...\r\n\r\nChampion maudit, Orion ne rêve que d\'une chose : arrêter le patinage artistique. Quand son coach lui impose une dernière partenaire, il craint qu\'elle finisse comme toutes les autres, blessée ou pire.\r\n\r\nSa plus grande fan, c\'est elle : Lily Pham.\r\n\r\nLa femme avec qui il doit cohabiter pour les quatre prochains mois.\r\n\r\nMalgré leurs débuts houleux, c\'est dans la tragédie que Lily et Orion se rapprochent en espérant remporter la première place.\r\n\r\nMais à quel prix...', '30', 17.00, 256, '2024-01-03', );
INSERT INTO `livre` (`livre_id`, `titre`, `auteur`, `id_genre`, `format`, `editeur`, `description`, `stock`, `prix`, `pages`, `date_publication`, `image`) VALUES
(15, 'Fourth Wing - Tome 1', 'Rebecca Yarros', 3, 'Broché', 'Hugo Roman', 'Passer toutes les épreuves… ou mourir !\r\n\r\nRien ne prédestinait Violet Sorrengail à être une cavalière. Elle était censée intégrer le quadrant des Scribes et mener une vie tranquille parmi les livres. Elle dont les os sont si fragiles qu’ils peuvent se briser en un instant…\r\n\r\nMais aujourd’hui est le jour des conscriptions, et en tant que fille de la Générale - elle-même cavalière et dresseuse de dragons -, Violet n’a d’autre choix que de satisfaire les ordres de sa mère, et de rejoindre les épreuves de sélection pour devenir dragonnière… L’élite de la Navarre !\r\n\r\nPourtant, le simple fait d’envisager s’inscrire à cette compétition lui paraît ridicule… Car les dragons ne se lient pas aux humains « fragiles » : ils les brûlent ! Mais Violet est peut-être la candidate la moins forte physiquement, elle est cependant rusée et rapide. Des qualités indispensables quand on évolue dans un monde sans foi ni loi, où les alliés peuvent vite devenir des ennemis, ou peut-être encore des conquêtes… Violet va vite devoir penser à un plan solide, car cette compétition n’a que deux issues : passer toutes les épreuves ou mourir !', '30', 21.50, 400, '2023-04-05', );
INSERT INTO `livre` (`livre_id`, `titre`, `auteur`, `id_genre`, `format`, `editeur`, `description`, `stock`, `prix`, `pages`, `date_publication`, `image`) VALUES
(16, 'Iron Flame', 'Rebecca Yarros', 3, 'Broché', 'Hugo Roman', 'Tout le monde s\'attendait à voir Violet Sorrengail échouer lors de sa première année à l\'Académie de la guerre de Basgiath, y compris elle-même...\r\n\r\nPourtant cette aventure endiablée n\'était qu\'une première épreuve, destinée à éliminer les faibles, les indignes et les malchanceux. Le véritable entraînement commence maintenant, et Violet se demande déjà comment elle va s\'en sortir. Ce n\'est pas seulement l\'épuisement, la brutalité, ou le fait que le programme soit conçu pour pousser les cavaliers au-delà de leur capacité de résistance à la douleur.\r\n\r\nC\'est surtout que le nouveau vice-commandant semble s’être donné pour mission de montrer à Violet à quel point elle est impuissante... A moins qu\'elle n’accepte de trahir l\'homme qu\'elle aime. Mais Violet possède le plus féroce des atouts : une volonté de fer. Et elle compte bien la mettre à profit de la leçon la plus importante que Basgiath lui ait enseignée : un dragonnier établit ses propres règles !', '30', 21.50, 400, '2024-06-05', );
INSERT INTO `livre` (`livre_id`, `titre`, `auteur`, `id_genre`, `format`, `editeur`, `description`, `stock`, `prix`, `pages`, `date_publication`, `image`) VALUES
(17, 'Les Secrets de la femme de ménage', 'Freida McFadden', 4, 'Poche', 'J\'ai Lu', 'Avec ce nouvel emploi, Millie semble avoir une chance en or. Chez les Garrick, un couple fortuné qui possède un somptueux appartement avec vue sur Manhattan, elle fait le ménage et prépare les repas dans la magnifique cuisine. Mais elle ne tarde pas à déceler quelques ombres au tableau... Son patron, Douglas Garrick, est d\'humeur de plus en plus changeante. Et pourquoi sa femme Wendy reste-t-elle toujours enfermée dans la chambre d\'amis ? Le jour où Millie découvre du sang sur une chemise de nuit, elle ne peut plus rester les bras croisés. Quelque chose se trame dans cette maison. Et cela pourrait bien se retourner contre elle si elle continue à fouiner dans les secrets des autres...', '', 8.60, 416, '2024-10-02', );
INSERT INTO `livre` (`livre_id`, `titre`, `auteur`, `id_genre`, `format`, `editeur`, `description`, `stock`, `prix`, `pages`, `date_publication`, `image`) VALUES
(18, 'Meri Jaan', 'Océane Ghanem', 2, 'Broché', 'Hugo Roman', 'Ola est verte de rage : en plus de s\'être fait larguer par l\'homme qu\'elle prenait pour son meilleur ami et l\'amour de sa vie, voilà qu\'il convole avec sa grande sœur ! — Ne sois pas surprise, Ola ! lui a-t-il lancé par-dessus son épaule, en claquant la porte du petit appartement qu\'ils partageaient depuis six ans. Tu le savais déjà... Blessée, puis vexée, Ola finit par admettre que... oui, peut-être... elle ne comprend rien aux hommes. Ni au sexe. Alors, avec l\'aide de ses meilleurs amis, elle échafaude une liste de 52 défis à réaliser sur 1 an. Tout ce qui lui a toujours semblé en dehors de sa portée, beaucoup trop osé pour une gentille fille dans son genre, est désormais inscrit à l\'encre noire sur son carnet. Mais c’était sans compter sur l’intervention de Saint Hunderson, son sublime voisin, et accessoirement, le meilleur ami de son ex. Qui ne l\'a jamais laissée indifférente, avec lequel elle partage de sombres secrets, et qui n\'a décidément rien d\'un saint homme ! La vilaine petite chenille deviendra-t-elle un joli papillon ? Ou risque-t-elle de se brûler les ailes avant même d\'avoir pu apprendre à voler ? ', '30', 18.00, 400, '2023-07-05', );
INSERT INTO `livre` (`livre_id`, `titre`, `auteur`, `id_genre`, `format`, `editeur`, `description`, `stock`, `prix`, `pages`, `date_publication`, `image`) VALUES
(19, 'Un Palais d épines et de roses Tome 1', ' Sarah J. Maas', 3, 'Broché', 'MARTINIERE J', 'En chassant dans les bois enneigés, Feyre voulait seulement nourrir sa famille. Mais elle a commis l&amp;amp;#039;irréparable en tuant un Fae, et la voici emmenée de force à Prythian, royaume des immortels.\r\nLà-bas, pourtant, sa prison est un palais magnifique et son geôlier n&amp;amp;#039;a rien d&amp;amp;#039;un monstre. Tamlin, un Grand Seigneur Fae, la traite comme une princesse.\r\nEt quel est ce mal qui ronge le royaume et risque de s&amp;amp;#039;étendre à celui des mortels ?\r\nA l&amp;amp;#039;évidence, Feyre n&amp;amp;#039;est pas une simple prisonnière. Mais comment une jeune humaine d&amp;amp;#039;origine aussi modeste pourrait-elle venir en aide à de si puissants seigneurs ?\r\nSa liberté, en tout cas, semble être à ce prix.\r\n\r\nATTENTION : Ce roman contient des scènes de sexe explicites. Nous la conseillons à partir de 16 ans', '30', 21.00, 528, '2017-02-09', );
INSERT INTO `livre` (`livre_id`, `titre`, `auteur`, `id_genre`, `format`, `editeur`, `description`, `stock`, `prix`, `pages`, `date_publication`, `image`) VALUES
(21, 'Icebreaker - Maple Hills Tome 1 ', 'Hanna Grace', 2, 'Broché', 'Hachette Lab', 'Patineuse artistique star de l\'équipe de Maple Hills, Anastasia Allen vit pour gagner. Son emploi du temps plus chargé que celui d’un ministre ne tourne qu’autour de son sport, laissant peu de place à l’imprévu.\r\nNathan Hawkins, lui, n\'a jamais rencontré de problème qu\'il ne pouvait pas résoudre. Et en tant que capitaine de l’équipe de hockey, il sait que sa responsabilité est de maintenir l’équipe soudée.\r\nIls ne s’étaient jamais croisés, mais lorsque la patinoire pour le hockey est détruite à la suite d’un malentendu, les deux équipes doivent s’adapter pour partager une seule et même patinoire. Stassie est plus qu’énervée contre cette équipe de hockey qui dérange son planning, mais surtout contre Nate, le capitaine aux larges épaules et au sourire facile en qui elle n’a aucune confiance. A l’inverse, Nate est immédiatement charmé par la furie qui le foudroie du regard à chaque occasion. Mais qu’importe, Stassie est immune au charme des hockeyeurs. N’est-ce pas ?', '30', 20.00, 500, '2023-08-23', );
INSERT INTO `livre` (`livre_id`, `titre`, `auteur`, `id_genre`, `format`, `editeur`, `description`, `stock`, `prix`, `pages`, `date_publication`, `image`) VALUES
(22, 'Un Palais de colère et de brume - Tome 2', 'Sarah J. Maas', 3, 'Broché', 'MARTINIERE J', 'Feyre a survécu aux défis d’Amarantha. Elle est devenue une Fae, créature immortelle, et a hérité de pouvoirs qu’elle ne maîtrise pas.\r\n\r\nMais son cœur est resté celui d’une humaine, et elle ne peut effacer ce qu’elle a dû commettre pour sauver Tamlin et la Cour du Printemps…\r\n\r\nElle ne peut non plus oublier qu’elle a conclu un marché avec Rhysand, le redoutable Grand Seigneur de la Cour de la Nuit. Une semaine par mois, elle doit séjourner à ses côtés, dans son palais. Et si elle est d’abord réticente, elle va découvrir qu’il est loin d’être le Fae cruel et manipulateur qu’elle pensait connaître. A ses côtés, elle va apprendre à dompter ses pouvoirs d’immortelle. Et douter de ce qu’elle ressent pour Tamlin…\r\n\r\nMais au-delà de la Cour de la Nuit, une menace se profile à l’horizon. Car les desseins du roi d’Hybern pourrait bien ébranler tout le royaume des immortels.\r\n\r\nATTENTION : Ce roman contient des scènes de sexe explicites. Nous la conseillons à partir de 16 ans', '30', 23.00, 720, '2018-02-08', );

